import React from 'react';

const backgroundURL = 'https://images.pexels.com/photos/67636/rose-blue-flower-rose-blooms-67636.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260';
const backgroundStyle =  `backgroundImage: 'url("${backgroundURL}")'`;

class background extends React.Component {
  render() {
     return(
    <div id="background" className="" style="${backgroundStyle}">

    </div>)
  }
}


export default background;
